import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { FaGoogle, FaGithub } from "react-icons/fa";
import { auth, googleProvider, githubProvider, signInWithPopup } from "../firebaseConfig";
import "./login.css";

const Login = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [popupMessage, setPopupMessage] = useState("");
  const navigate = useNavigate();

  // Function for Email/Password Login
  const handleLogin = () => {
    const storedUser = JSON.parse(localStorage.getItem("user"));

    if (storedUser && storedUser.email === email && storedUser.password === password) {
      setPopupMessage("✅ Login Successful! Redirecting...");
      setTimeout(() => {
        navigate("/otp");
      }, 2000);
    } else {
      setPopupMessage("❌ User not registered! Please sign up.");
    }

    setTimeout(() => setPopupMessage(""), 2000);
  };

  // Google Login
  const handleGoogleLogin = async () => {
    try {
      const result = await signInWithPopup(auth, googleProvider);
      localStorage.setItem("user", JSON.stringify(result.user));
      setPopupMessage("✅ Google Login Successful! Redirecting...");
      setTimeout(() => navigate("/otp"), 2000);
    } catch (error) {
      setPopupMessage("❌ Google Login Failed!");
    }
    setTimeout(() => setPopupMessage(""), 2000);
  };

  // GitHub Login
  const handleGithubLogin = async () => {
    try {
      const result = await signInWithPopup(auth, githubProvider);
      localStorage.setItem("user", JSON.stringify(result.user));
      setPopupMessage("✅ GitHub Login Successful! Redirecting...");
      setTimeout(() => navigate("/otp"), 2000);
    } catch (error) {
      setPopupMessage("❌ GitHub Login Failed!");
    }
    setTimeout(() => setPopupMessage(""), 2000);
  };

  return (
    <div className="login-card">
      <h2>Login to Your Account</h2>

      {/* Social Login Buttons */}
      <div className="social-login">
        <button className="social-btn google-btn" onClick={handleGoogleLogin}>
          <FaGoogle className="icon" /> Google
        </button>
        <button className="social-btn github-btn" onClick={handleGithubLogin}>
          <FaGithub className="icon" /> GitHub
        </button>
      </div>

      <div className="separator"><span>or continue with email</span></div>

      <div className="input-group">
        <label>Email</label>
        <input type="email" placeholder="Enter your email" value={email} onChange={(e) => setEmail(e.target.value)} />
      </div>

      <div className="input-group">
        <label>Password</label>
        <input type="password" placeholder="Enter your password" value={password} onChange={(e) => setPassword(e.target.value)} />
      </div>

      <div className="options">
        <label>
          <input type="checkbox" /> Remember me
        </label>
        <a href="#">Forgot Password?</a>
      </div>

      <button className="login-btn" onClick={handleLogin}>Login</button>

      <p className="create-account">
        Don't have an account? <a href="/signup">Sign up</a>
      </p>

      {popupMessage && <div className="popup"><p>{popupMessage}</p></div>}
    </div>
  );
};

export default Login;
